def validPalindrome(s):
    if s == str(s)[::-1]:
        return True
    else:
        for x in range(len(list(s))):
            ls = list(s)
            ls.pop(x)
            if str("".join(ls)) == str("".join(ls))[::-1]:
                return True
        else:
            return False
